import React from 'react';
import logo from '../../../../images/logo.png'
import './Buy.css'

const Buy = () => {
    return (
        <>
            <div className='buy-logo'>
                <img src={logo} alt="" width="100px" height="100px" />
            </div>
        </>
    );
}

export default Buy;
